import React, { useState, useRef } from 'react';
import { Map, TileLayer } from 'react-leaflet';
import './App.css';
import 'leaflet/dist/leaflet.css';

const defaultCenter = [39.8283, -98.5795]; // Geographical center of the continental USA
const defaultZoom = 4;

function App() {
  const mapRef = useRef();
  const [dateRange] = useState({ startDate: '', endDate: '' });
  const [showTraffic] = useState(true);
  const [showConstruction] = useState(true);
  const [realTimeData] = useState(false);
  const [accidentType, setAccidentType] = useState('');
  const [constructionType, setConstructionType] = useState('');
  const [geographicArea, setGeographicArea] = useState('');
  const [timeOfDay, setTimeOfDay] = useState('');

  return (
    <div className="App">
      <Map ref={mapRef} center={defaultCenter} zoom={defaultZoom} className="map">
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution="&copy; OpenStreetMap contributors"
        />
      </Map>
      <div className="sidebar">
        <h2>Filter Panel</h2>
        {/* Existing filters... */}
        {/* New filters added below */}

        <div className="filter-option">
          <input
            type="checkbox"
            id="showTraffic"
            checked={showTraffic}
          />
          <label htmlFor="showTraffic">Accident Dataset</label>
        </div>
        <div className="filter-option">
          <input
            type="checkbox"
            id="showConstruction"
            checked={showConstruction}
          />
          <label htmlFor="showConstruction">Road Construction Dataset</label>
        </div>
        <div className="filter-option">
          <input
            type="checkbox"
            id="realTimeData"
            checked={realTimeData}
          />
          <label htmlFor="realTimeData">Correlation Maps</label>
        </div>
        <div className="date-picker">
          <label htmlFor="constructionType">Date Range Selection</label>
          <label htmlFor="constructionType"> </label>
          <label htmlFor="startDate"> Start Date:</label>
          <input
            type="date"
            id="startDate"
            name="startDate"
            value={dateRange.startDate}
          />
        </div>
        <div className="date-picker">
          <label htmlFor="endDate">End Date:</label>
          <input
            type="date"
            id="endDate"
            name="endDate"
            value={dateRange.endDate}
          />
        </div>
        <div className="filter-option">
          <label htmlFor="accidentType">Accident Type:</label>
          <select id="accidentType" value={accidentType} onChange={(e) => setAccidentType(e.target.value)}>
            {/* Populate with options */}
          </select>
        </div>
        <div className="filter-option">
          <label htmlFor="constructionType">Construction Type:</label>
          <select id="constructionType" value={constructionType} onChange={(e) => setConstructionType(e.target.value)}>
            {/* Populate with options */}
          </select>
        </div>
        <div className="filter-option">
          <label htmlFor="geographicArea">Geographic Area:</label>
          <select id="geographicArea" value={geographicArea} onChange={(e) => setGeographicArea(e.target.value)}>
            {/* Populate with options */}
          </select>
        </div>
        <div className="filter-option">
          <label htmlFor="timeOfDay">Time of Day:</label>
          <select id="timeOfDay" value={timeOfDay} onChange={(e) => setTimeOfDay(e.target.value)}>
            {/* Populate with options */}
          </select>
        </div>
        <button className="generate-report-btn">Generate Report</button>
      </div>
    </div>
  );
}

export default App;
